import React from 'react'

const StageThree = ( {stageThree} ) => {
  return (
    <div>
        <h1>Terceira tela do jogo</h1>
        <div className="button">
        <button className='button-87' onClick={stageThree}> Verificar </button>
        </div>
    </div>
  )
}

export default StageThree
